import { Route, Routes } from 'react-router-dom';
import { publicRoutes } from './Routes';

function App() {
  return (
    <div className="App">
      <Routes>
        {publicRoutes.map((route, index) => (
          <Route path={route.path} />
        ))}
      </Routes>
    </div>
  );
}

export default App;
